gacH(){return"Being alone in the process can be difficult, trying to understand the platform, how much daily budget to invest, making mistakes, getting disabled, not knowing if the strategy will work, and how to analyze the results can be a headache.\n\nThat's why this consultation will help you get a more accurate picture of what you need and accelerate the process your business should have.\n\nWith my experience in the world of digital advertising, I can provide you with a clearer vision of what you require to increase sales.\n\nIn 2021, I started offering these consultations and have perfected the methodology so you can use this time to clarify all your doubts, solve those common mistakes that hinder your progress, correct them, and hit the mark in positioning your business.\n\nUpon purchasing the service, you will receive an email with the information you need for that day, allowing us to make the most of the consultation."},
gaaH(){return"What Will We Discuss in the Meeting?"},
gaaI(){return"Business Plan\nI will analyze whether your proposal will be profitable with the services or products you want to market online.\n\nCampaigns\nWhether created or not, I will review their structure and strategy strategically.\n\nWebsite\nI will examine the entire structure and provide you with the means to sell more through your website.\n\nSales Method\nDepending on the methodology, we will improve how you close deals with your customers."},
gA9(){return"Frequently Asked Questions"},
gaag(){return"Does it matter if I know nothing about Facebook - Instagram or Tik Tok Ads?\nNo, think of it as private lessons just for you.\n\nIf I already know and run campaigns, is this for me?\nYes, I will give your business a general examination and show you how to improve in the areas where you are struggling with ads.\n\nCan I extend our call beyond 1 hour?\nCertainly, if you need more lessons, we can coordinate the time and day for additional sessions at the end of our meeting. Be prepared for this challenge; I will send you many tasks.\n\nWhere will the video call take place?\nIt will be conducted through the Zoom platform.\n\nWhat if I'm not satisfied with my mentoring?\nIf it's not what you expected, I will refund your entire payment.\n\nI encountered an issue, can I reschedule our meeting?\nYou have 24 hours at the latest to schedule another day and time. You must notify us at the following email address: hola@jpdirector.net.\n\nIf you fail to do so within that time, you will lose your investment and need to pay for a new consultation."},
ga5r(){return"During the first month, I will teach you everything I know, and together we will create and launch your advertising plan where you will learn the right way to grow your business.\n\nIn the following month, we will have several results analysis sessions with the plan we developed, progressively optimizing your advertising."},
gEZ(){return"I'm Ready, Let's Begin."},
gaaJ(){return"What Will We Cover During These 2 Months?"},
gaaK(){return"-From zero to 100, all the factors and tools necessary for your advertising strategy.\n\n-Comprehensive education in Instagram - Facebook - Tik Tok for running profitable advertising campaigns.\n\n-Strategy and results analysis for optimization decisions."},
gaad(){return"1. Do I need a high budget to invest in my campaigns?\nThis is very relative and depends on your product or service. What you do need to consider is having at least $3000 USD to conduct numerous tests and perform a thorough results analysis during this time.\n\n2. I understand a lot, but I want more details.\nSince this service is specialized, we will have a 20-minute video call to determine if your business is prepared and committed. During the call, I will explain in more detail all your doubts.\n\n3. What is the cost of intensive mentoring?\nThe price starts at $12,000 USD, depending on multiple factors that we will discuss in the video call.\n\n4. Not a question, I want you to be my mentor!\nCalm down, let's have a conversation first and see if you are prepared and meet the requirements. If you are reading this, you already have the first requirement: Willingness."},
ga6b(){return"This service is designed for you, who are looking for someone to take care of the strategy and management of your brand's advertising. I will focus on growth, acquiring quality leads, and increasing sales."},
ga3r(){return"How?"},
ga52(){return"Strategy Design"},
ga53(){return"I will develop clear and precise strategies with defined timelines, prioritizing your different ideal customers, supported by all the necessary research to persuasively impact them."},
ga3E(){return"Campaign Setup"},
ga3F(){return"I will handle all the technical aspects within the platform to ensure that campaigns run smoothly according to the established strategy."},
ga9N(){return"Optimization"},
ga9O(){return"Effective optimization means analyzing the data and making decisions to improve results over time, ensuring continuous success."},
gaa8(){return"Why Me?"},
gaa9(){return"SELECTIVE AND SINCERE\nBeing in charge of your brand requires commitment and responsibility. That's why I will thoroughly analyze your business before we start to determine if you meet all the requirements for me to support you.\n\nIf it's a YES, we will create an effective action plan.\n\nIf it's a NO, I will provide honest feedback and refer you to the specialist or plan your business needs.\n\nPRICE BASED ON YOUR BUSINESS MODEL\nOne of my distinguishing features is that I thoroughly review your business before starting, and even by evaluating it together with you, I can determine if you are ready to take this step.\n\nMy promise is that when you purchase my service, it will be a great relief, and you will see results.\n\nEXPERIENCE AND RESULTS\nFrom strategy creation, copywriting, creative ads, segmentation, web conversion funnels, budget management, to results analysis, these are all within my capabilities for taking on this role."},
gaae(){return"What is the average cost for you to take charge of advertising for my business?\nThe price starts at $6000 and goes up, depending on many factors and the goals you have as a business. That's why I take the time to analyze in advance and determine if I can take on the project.\n\nWill I see results immediately?\nThis is a common question, and it depends on how the strategy is implemented, your product, price, and perceived value to your audience.\n\nThe correct answer is that I will ensure you make a smart impact on your target audience.\n\nOnce I fill out the form, what will happen?\nWithin 2 to 3 days, I will contact you to provide all the details. We will have a 30-minute meeting to fully understand your needs and numbers."},
