ga67(){return"This privacy policy, along with the legal notice, cookie policy, sales policy, terms and conditions, and any other referenced policy, identifies how personal data received on this website is collected and processed.\nThe information on this website is not intended for children. A child will be defined as provided by the law of the jurisdiction where it is so defined; in the case of the United States of America, it is someone under the age of 13. If the user believes that a child has provided their personal data on this website without parental consent, they should write to hola@jpdirector.net.\nIf the user is under 13 years old, they must have the authorization of their parents or legal guardians to provide their personal data. JPDIRECTOR has no way of effectively verifying the age of users, so it is exempt from any responsibility if the user does not comply with what is indicated here. At JPDIRECTOR, we comply with the Children's Online Privacy Protection Act of 1998 (\u201cCOPPA\u201d).\nData identifying the data controller\nAs required by current regulations, we inform you that:\n"},
