ga8x(){return"JPDIRECTOR will always ensure that the use of the website, its contents, and the processing of user's personal data are carried out correctly. For this purpose, the user can always exercise their rights of access, rectification, limitation, cancellation, portability, forgetfulness, or opposition, all in faithful compliance with the guidelines of the laws governing the matter, by writing to JPDIRECTOR. JPDIRECTOR does not sell or will sell users' personal data to other companies or third parties.\n"},
